css:
.build-settings {
  cursor: default;
  -webkit-user-select: none;
  height: 100%;
  display: flex;
  flex-direction: column;
}
.build-settings #config {
  overflow-y: auto;
}
.build-settings .top {
  display: flex;
  flex-flow: row wrap;
  justify-content: space-between;
}
.build-settings .top .align {
  display: flex;
  padding: 0 0 0 5px;
}
.build-settings .panel-heading .panel-text {
  font-size: 1.25em;
  font-weight: bold;
}
.build-settings .panel-heading .btn {
  top: 0px;
}
